function formatNumberWithThousandsSeparator($number) {
    return number_format($number, 0, '', ',');
}

function formatNumber($number) {    
    return number_format($number, 0, '', '.');
}

function formatNumberWithHyphen($numberString) {    
    $parts = explode('-', $numberString);
    
    foreach ($parts as &$part) {        
        if (is_numeric($part)) {
            $part = number_format($part, 0, '', '.');
        }
    }
    
    return implode('-', $parts);
}

function numberToWords($number) {
    $hyphen = ' ';
    $conjunction = ' y ';
    $separator = ' ';
    $negative = 'menos ';
    $decimal = ' punto ';
    $dictionary = array(
        0 => 'cero',
        1 => 'uno',
        2 => 'dos',
        3 => 'tres',
        4 => 'cuatro',
        5 => 'cinco',
        6 => 'seis',
        7 => 'siete',
        8 => 'ocho',
        9 => 'nueve',
        10 => 'diez',
        11 => 'once',
        12 => 'doce',
        13 => 'trece',
        14 => 'catorce',
        15 => 'quince',
        16 => 'dieciséis',
        17 => 'diecisiete',
        18 => 'dieciocho',
        19 => 'diecinueve',
        20 => 'veinte',
        30 => 'treinta',
        40 => 'cuarenta',
        50 => 'cincuenta',
        60 => 'sesenta',
        70 => 'setenta',
        80 => 'ochenta',
        90 => 'noventa',
        100 => 'cien',
        200 => 'doscientos',
        300 => 'trescientos',
        400 => 'cuatrocientos',
        500 => 'quinientos',
        600 => 'seiscientos',
        700 => 'setecientos',
        800 => 'ochocientos',
        900 => 'novecientos',
        1000 => 'mil',
        1000000 => 'millón',
        1000000000 => 'mil millones'
    );

    if (!is_numeric($number)) {
        return false;
    }

    if ($number < 0) {
        return $negative . numberToWords(abs($number));
    }

    $string = $fraction = null;

    if (strpos($number, '.') !== false) {
        list($number, $fraction) = explode('.', $number);
    }

    switch (true) {
        case $number < 21:
            $string = $dictionary[$number];
            break;
        case $number < 100:
            $tens = ((int) ($number / 10)) * 10;
            $units = $number % 10;
            $string = $dictionary[$tens];
            if ($units) {
                $string .= $conjunction . $dictionary[$units];
            }
            break;
        case $number < 1000:
            $hundreds = (int) ($number / 100) * 100;
            $remainder = $number % 100;
            if ($number == 100) {
                $string = "cien";
            } else {
                $string = $dictionary[$hundreds];
                if ($remainder) {
                    $string .= $separator . numberToWords($remainder);
                }
            }
            break;
        case $number < 1000000:
            $thousands = (int) ($number / 1000);
            $remainder = $number % 1000;
            if ($thousands == 1) {
                $string = 'mil';
            } else {
                $string = numberToWords($thousands) . ' mil';
            }
            if ($remainder) {
                $string .= $separator . numberToWords($remainder);
            }
            break;
        case $number < 1000000000:
            $millions = (int) ($number / 1000000);
            $remainder = $number % 1000000;
            if ($millions == 1) {
                $string = 'un millón';
            } else {
                $string = numberToWords($millions) . ' millones';
            }
            if ($remainder) {
                $string .= $separator . numberToWords($remainder);
            }
            break;
    }

    if ($fraction !== null && is_numeric($fraction)) {
        $string .= $decimal;
        $words = [];
        foreach (str_split((string) $fraction) as $digit) {
            $words[] = $dictionary[$digit];
        }
        $string .= implode(' ', $words);
    }

    return $string;
}

function formatCustomDate($dateString) {
    $date = new DateTime($dateString);
    
    $months = [
        1 => 'enero', 'febrero', 'marzo', 'abril', 'mayo', 'junio', 
        'julio', 'agosto', 'septiembre', 'octubre', 'noviembre', 'diciembre'
    ];
    
    $day = $date->format('d');
    $month = $months[(int)$date->format('m')];
    $year = $date->format('Y');
    
    return "$day de $month del año gravable $year";
}

function formatCustomDate2($dateString) {
    $date = new DateTime($dateString);
    
    $months = [
        1 => 'enero', 'febrero', 'marzo', 'abril', 'mayo', 'junio', 
        'julio', 'agosto', 'septiembre', 'octubre', 'noviembre', 'diciembre'
    ];
    
    $day = $date->format('d');
    $month = $months[(int)$date->format('m')];
    $year = $date->format('Y');
    
    return "$day de $month de $year";    
}

